import React, { useEffect, useState } from 'react';

const Images = () => {
  const [livePhotos, setLivePhotos] = useState([]);

  useEffect(() => {
    // Fetch live photos from the API
    fetch("http://localhost:5000/api/admin/live-photos")
      .then(res => res.json())
      .then(photos => setLivePhotos(photos));
  }, []);
  return (
    <>
      {/* Hero Section */}
      <section className="hero">
        <div className="hero-content">
          <div className="logos-container">
            <img src="images/logos/rotary with unit.png" alt="Rotary with Unit Logo" className="hero-logo" />
            <img src="images/logos/rotaract with see.png" alt="Rotaract with See Logo" className="hero-logo" />
          </div>
          
          <div className="main-logo-container">
            <img src="images/logos/Sample Logo 3D 1.png" alt="Brahmastra Main Event Logo" className="main-event-logo" />
          </div>
        </div>
      </section>

      {/* Photo Gallery Section */}
      <section>
        <div className="container">
          <div className="section-title">
            <h2 style={{ color: 'black' }}>Event Gallery</h2>
            <p>Relive the exciting moments from our sports meet</p>
          </div>
          
          <div className="gallery-container">
            {/* Gallery Item 1 */}
            <div className="gallery-item">
              <div className="gallery-image" style={{ backgroundImage: "url('images/throball.jpg')" }}></div>
            </div>
            
            {/* Gallery Item 2 */}
            <div className="gallery-item">
              <div className="gallery-image" style={{ backgroundColor: '#2196F3' }}></div>
            </div>
            
            {/* Gallery Item 3 */}
            <div className="gallery-item">
              <div className="gallery-image" style={{ backgroundColor: '#FF9800' }}></div>
            </div>
            
            {/* Gallery Item 4 */}
            <div className="gallery-item">
              <div className="gallery-image" style={{ backgroundColor: '#9C27B0' }}></div>
            </div>
            
            {/* Gallery Item 5 */}
            <div className="gallery-item">
              <div className="gallery-image" style={{ backgroundColor: '#E91E63' }}></div>
            </div>
            
            {/* Gallery Item 6 */}
            <div className="gallery-item">
              <div className="gallery-image" style={{ backgroundColor: '#00BCD4' }}></div>
            </div>
            
            {/* Gallery Item 7 */}
            <div className="gallery-item">
              <div className="gallery-image" style={{ backgroundColor: '#8BC34A' }}></div>
            </div>
            
            {/* Gallery Item 8 */}
            <div className="gallery-item">
              <div className="gallery-image" style={{ backgroundColor: '#FFC107' }}></div>
            </div>
            
            {/* Gallery Item 9 */}
            <div className="gallery-item">
              <div className="gallery-image" style={{ backgroundColor: '#795548' }}></div>
            </div>
            
            {/* Gallery Item 10 */}
            <div className="gallery-item">
              <div className="gallery-image" style={{ backgroundColor: '#607D8B' }}></div>
            </div>
            
            {/* Gallery Item 11 */}
            <div className="gallery-item">
              <div className="gallery-image" style={{ backgroundColor: '#FF5722' }}></div>
            </div>
            
            {/* Gallery Item 12 */}
            <div className="gallery-item">
              <div className="gallery-image" style={{ backgroundColor: '#9E9E9E' }}></div>
            </div>
          </div>
        </div>
      </section>

      {/* Live Photos Section */}
      {livePhotos.length > 0 && (
        <section>
          <div className="container">
            <div className="section-title">
              <h2 style={{ color: 'black' }}>Event Gallery</h2>
              <p>Latest moments from the ongoing events</p>
            </div>
            
            <div className="gallery-container">
              {livePhotos.map((photo, index) => (
                <div key={photo._id || index} className="gallery-item">
                  <div className="gallery-image" style={{ 
                    backgroundImage: `url('http://localhost:5000${photo.imageUrl}')`,
                    backgroundSize: 'cover',
                    backgroundPosition: 'center'
                  }}></div>
                  <div className="photo-timestamp">
                    {new Date(photo.timestamp).toLocaleString()}
                  </div>
                </div>
              ))}
            </div>
          </div>
        </section>
      )}
    </>
  );
};

export default Images;
